import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

class ListOpenedPositions extends Component {

  constructor( props )
  {

    super(props);

  }

  processSector( sector )
  {

    return (
      <div>
        <label data-label-carrer>{ sector.sector }</label>

        {
          sector.positions.map( ( position ) => {
            return (
              <div data-content-job>
                <p data-title>Desenvolvedor NodeJs Senior</p>
                <p data-location>Remoto</p>
              </div>
            );
          })
        }
      </div>
    );

  }

  render() {

    let self          = this;
    var { positions } = this.props;

    let content_positions = positions.map( ( sector ) => {
      return self.processSector( sector );
    } )

    return (

      <div className="container-page">

        { content_positions }

        <label data-label-carrer>Desenvolvedores</label>

        <div data-content-job>
          <p data-title>Desenvolvedor NodeJs Senior</p>
          <p data-location>Remoto</p>
        </div>

        <div data-content-job>
          <p data-title>Desenvolvedor PHP Pleno</p>
          <p data-location>Remoto</p>
        </div>

        <label data-label-carrer>Vendas</label>

        <div data-content-job>
          <p data-title>Vendedor Externo</p>
          <p data-location>Remoto</p>
        </div>

        <label data-label-carrer>Marketing</label>

        <div data-content-job>
          <p data-title>SEO</p>
          <p data-location>Remoto</p>
        </div>

      </div>
    );
  }
}
export default ListOpenedPositions;
